'use strict';

const image64 = `
data:image/jpeg;base64,
`

const image = document.createElement("img");
image.src = image64;

const canvas2 = document.createElement("canvas");
canvas2.width = image.width;
canvas2.height = image.height;
const ctx2 = canvas2.getContext("2d");
ctx2.drawImage(image, 0, 0);

export async function initPhysics() {
	// setTimeout(() => {
	const imagedata = ctx2.getImageData(0, 0, image.width, image.height);
	const canvas = document.getElementById('amedomary');

	canvas.width = innerWidth - 20;
	canvas.height = innerHeight - 20;
	// const ctx = canvas.getContext('2d');

	const paddingTop = (canvas.width / 2) - (image.width / 2);
	const paddingLeft = (canvas.height / 2) - (image.height / 2);
	const centerW = canvas.width / 2;
	const centerH = canvas.height / 2;

	const mash = [];
	const dotSize = 1;
	const imgStep = dotSize * 1;
	const speed = {
		down: 2,
		top: 12,
	}

	function getRandomArbitrary(min, max) {
		return Math.random() * (max - min) + min;
	}

	function getAngle(x1, y1, x2, y2) {
		const a = y1 - y2;
		const b = x1 - x2;
		const c = Math.sqrt((a ** 2 + b ** 2));
		const cos = a / c;
		const sin = b / c;

		return { cos, sin }
	}

	class Dot {
		constructor(x, y, color) {
			this._x = x + paddingTop - innerWidth / 2;
			this._y = y + paddingLeft - innerHeight / 2;

			this.x = getRandomArbitrary(0, canvas.width);
			this._dx2 = Math.abs((centerW - this.x)) ** 2;
			this._radius2 = ((canvas.width) / 2) ** 2;
			this._dy = Math.sqrt(this._radius2 - this._dx2);

			// this._d = Math.sqrt(((canvas.width) / 2) - (((canvas.width / 2) + this.x) ** 2));
			this.y = getRandomArbitrary(centerH - this._dy, centerH + this._dy);
			// this.y = getRandomArbitrary(0, canvas.height);

			this._color = color;
			this.color = color;
			// this.r = dotSize;
			this.state = 'passive';
			this.d = 0;
			this.v = getRandomArbitrary(speed.down, speed.top);
			this.move = true;
			this.angle = getAngle(this.x, this.y, this._x, this._y);
		}

		checkPosition() {
			if (this.move) {
				let newX;
				let newY;
				const xIsOnPosition = Math.abs(this.x - this._x) < speed.top + 1;
				const yIsOnPosition = Math.abs(this.y - this._y) < speed.top + 1;

				if (xIsOnPosition && yIsOnPosition) {
					newX = this._x;
					newY = this._y;
				} else {
					newX = this.x - (this.v * this.angle.sin);
					newY = this.y - (this.v * this.angle.cos);
				}

				this.x = Math.fround(newX);
				this.y = Math.fround(newY);
			}
		}

		getXYZC() {
			return [this.x, this.y, 0, 0.5, this.color.r , this.color.g , this.color.b];
		}
	};

	function getPixel(imagedata, x, y) {
		const position = (x + imagedata.width * y) * 4;
		const data = imagedata.data;
		return { r: data[position], g: data[position + 1], b: data[position + 2], a: data[position + 3] };
	};

	function createDataMash() {
		for (let y = 0, y2 = imagedata.height; y < y2; y += imgStep) {
			for (let x = 0, x2 = imagedata.width; x < x2; x += imgStep) {
				const pixelColor = getPixel(imagedata, x, y);
				const color ={ r: pixelColor.r / 255, g: pixelColor.g / 255, b: pixelColor.b / 255 }
				// console.log(color);


				if (
					pixelColor.r < 30 &&
					pixelColor.g < 30 &&
					pixelColor.b < 30
				) { } else {
					mash.push(new Dot(x, y, color));
					mash.push(0);
					mash.push(0);
					mash.push(0);
					mash.push(0);
					mash.push(0);
					mash.push(0);
				}
			}
		}
		// requestAnimationFrame(renderLoop);
	};

	function reDrawDots() {
		const f32aMy = new Float32Array(mash.length);

		for (let i = 0; i < f32aMy.length; i += 7) {
			const xyzc = mash[i].getXYZC();
			f32aMy[i + 0] = xyzc[0];
			f32aMy[i + 1] = xyzc[1];
			f32aMy[i + 2] = xyzc[2];
			f32aMy[i + 3] = xyzc[3];
			f32aMy[i + 4] = xyzc[4];
			f32aMy[i + 5] = xyzc[5];
			f32aMy[i + 6] = xyzc[6];
		}

		reCalculateDot();
		return f32aMy;
	};

	function reCalculateDot(params) {
		for (let i = 0; i < mash.length; i += 7) {
			mash[i].checkPosition();
		}
	}

	createDataMash();

	let f32a = new Float32Array(0);

	function getData() {
		return f32a;
	}

	// loop
	function tick(count) {
		f32a = reDrawDots();

		const newArray = new Float32Array(count * 7);
		newArray.set(f32a);
		f32a = newArray;
	}

	const partCount = mash.length / 7;

	return { getData, tick, partCount };
};

function resizeArray(sourceArray, targetLength) {
	const newArray = new Float32Array(targetLength);
	newArray.set(sourceArray);
	return newArray;
}
